import React from 'react';
import './App.css';

function App() {
  return (
    <div className="app">
      <div className="container f fd-v">

        <div className="header">
          <input className="search-input" type="text" />
        </div>
        <div className="content f">
          <div className="tile">Yesterday</div>
          <div className="tile">Today</div>
          <div className="tile">Tomorrow</div>
        </div>

      </div>
    </div>
  );
}

export default App;
